import axios from 'axios';

class App extends React.Component {
  state = {
    images: []
  }

  generateImages = () => {
    axios.post('/generate-images', { descriptions: ['просторы Казахстана', 'горные пейзажи', 'морские виды'] })
      .then(response => {
        this.setState({ images: response.data });
      })
      .catch(error => {
        console.log(error);
      });
  }

  render() {
    return (
      <div>
        <button onClick={this.generateImages}>Сгенерировать картинки</button>
        {this.state.images.map((image, index) => (
          <img key={index} src={`data:image/jpeg;base64,${image}`} alt={`Generated Image ${index}`} />
        ))}
      </div>
    );
  }
}
